contracts/order_database.sol.content:
pragma solidity >=0.7.0 <0.9.0;
import "./order.sol";
contract OrderDb {
    Order[] order_list;
    event show_order(uint,uint,address,address,bool);
    function add_order(Order order) public{
        order_list.push(order);
    }
    function get_count() public view returns(uint) {
        return order_list.length;
    }
    function display_all_orders() public { 
        for(uint i=0;i<order_list.length;i++){
            Order order = order_list[i];
            emit show_order(order.get_order_id(),order.get_quantity(),order.get_orderer(),order.get_supplier(),order.is_accepted());
        }
    }
    function search_order(uint _order_id) public view returns(int){
        for(uint i=0;i<order_list.length;i++){
            if(_order_id == order_list[i].get_order_id()){
                return int(i);
            }
        }
        return -1;
    }
    function accept_order(uint _order_id) public {
        order_list[_order_id].accept();
    }
}

contracts/order.sol.content:
pragma solidity >=0.7.0 <0.9.0;

contract Order {
    uint order_id;
    uint quantity;
    address orderer;
    address supplier;
    bool accepted;
    constructor(uint _order_id,
    uint _quantity,
    address _orderer,
    address _supplier,
    bool _accepted) {
        order_id = _order_id;
        quantity = _quantity;
        orderer = _orderer;
        supplier = _supplier;
        accepted = _accepted;
    }
    function get_order_id() public  view returns(uint) {
        return order_id;
    }

    function get_quantity() public  view returns(uint) {
        return quantity;
    }

    function get_orderer() public  view returns(address) {
        return orderer;
    }

    function get_supplier() public  view returns(address) {
        return supplier;
    }

    function is_accepted() public  view returns(bool) {
        return accepted;
    }
    function accept() public {
        accepted = true;
    }
}

